import React from 'react';
import {connect} from 'react-redux'
import './view-lines.styles.scss'

const ViewLines = ({userTeam, opponentTeam}) => (
    <div className = 'view-lines'>
    <div className = 'view-lines-content'>
      <h1>View Lines</h1>  
      <div className = 'lineups' style={{display:'flex', width:'50%', marginLeft:'25%'}}>
      <table className = 'team'>
      {Object.keys(userTeam).map((position, i) => (<tr className = {(i+1)%2===0 ? 'dark' : ''}><td>{userTeam[position].name} &nbsp; &nbsp; {userTeam[position].position} &nbsp; &nbsp;{userTeam[position].team}</td><td>{Math.round(100*userTeam[position].projectedPoints)/100}</td></tr>))}
      </table>
      <table className = 'positions-for-teams'>
      {Object.keys(userTeam).map((position, i) => (<tr><td className='position-view-lines'>{position}</td></tr>))}
      </table>
      <table className = 'team'>
      {Object.keys(opponentTeam).map((position, i) => (<tr className = {(i+1)%2===0 ? 'dark' : ''}><td>{opponentTeam[position].name}</td><td>{Math.round(100*opponentTeam[position].projectedPoints)/100}</td></tr>))}
      </table>
      </div>
      </div>
    </div>
)

const mapStateToProps = state => ({
  userTeam: state.lineup.userTeam,
  opponentTeam: state.lineup.opponentTeam
})
export default connect(mapStateToProps,null)(ViewLines)
